import React from 'react';

// Mapping of rune styles and perks to their respective names
const RUNE_STYLE_NAMES = {
  8100: 'Domination',
  8300: 'Inspiration',
  8000: 'Precision',
  8400: 'Resolve',
  8200: 'Sorcery',
};

const RUNE_PERK_NAMES = {
  // Domination
  8112: 'Electrocute',
  8124: 'Predator',
  8128: 'DarkHarvest',
  9923: 'HailOfBlades',
  8136: 'ZombieWard',
  8138: 'GhostPoro',
  8135: 'EyeballCollection',
  8139: 'TasteOfBlood',
  8143: 'SuddenImpact',
  8134: 'IngeniousHunter',
  8105: 'RelentlessHunter',
  8106: 'UltimateHunter',
  8109: 'TreasureHunter',

  // Inspiration
  8351: 'GlacialAugment',
  8360: 'UnsealedSpellbook',
  8358: 'MasterKey',
  8306: 'HextechFlashtraption',
  8304: 'MagicalFootwear',
  8313: 'PerfectTiming',
  8321: 'FutureMarket',
  8316: 'MinionDematerializer',
  8345: 'BiscuitDelivery',
  8347: 'CosmicInsight',
  8410: 'ApproachVelocity',
  8352: 'TimeWarpTonic',

  // Precision
  8005: 'PressTheAttack',
  8008: 'LethalTempo',
  8021: 'FleetFootwork',
  8010: 'Conqueror',
  9101: 'Overheal',
  9111: 'Triumph',
  8009: 'PresenceOfMind',
  9104: 'LegendAlacrity',
  9105: 'LegendTenacity',
  9103: 'LegendBloodline',
  8014: 'CoupDeGrace',
  8017: 'CutDown',
  8299: 'LastStand',

  // Resolve
  8437: 'GraspOfTheUndying',
  8439: 'Aftershock',
  8465: 'Guardian',
  8446: 'Demolish',
  8463: 'FontOfLife',
  8444: 'ShieldBash',
  8473: 'Conditioning',
  8401: 'SecondWind',
  8429: 'BonePlating',
  8451: 'Overgrowth',
  8453: 'Revitalize',
  8242: 'Unflinching',

  // Sorcery
  8214: 'SummonAery',
  8229: 'ArcaneComet',
  8230: 'PhaseRush',
  8224: 'NullifyingOrb',
  8226: 'ManaflowBand',
  8275: 'NimbusCloak',
  8210: 'Transcendence',
  8234: 'Celerity',
  8233: 'AbsoluteFocus',
  8237: 'Scorch',
  8232: 'Waterwalking',
  8236: 'GatheringStorm'
};

function Match({ match }) {
  if (!match) return null;

  const {
    champion,
    win,
    items,
    kills,
    deaths,
    assists,
    gameDuration,
    summonerSpells,
    runes,
    participants,
    version
  } = match;

  const matchOutcome = win ? 'Victory' : 'Defeat';
  const outcomeClass = win ? 'match-outcome-victory' : 'match-outcome-defeat';
  const outcomeColor = win ? '#3de168' : '#f84848';  // Bright green for win, bright red for loss

  const championImage = (
    <img
      src={`https://ddragon.leagueoflegends.com/cdn/${version}/img/champion/${champion}.png`}
      alt={`${champion}`}
      className="champion-image"
      style={{ width: '80px', height: '80px' }}
    />
  );

  const itemImages = items
    .filter(itemId => itemId > 0)
    .map((itemId, index) => (
      <img
        key={`${itemId}-${index}`}
        src={`https://ddragon.leagueoflegends.com/cdn/${version}/img/item/${itemId}.png`}
        alt={`Item ${itemId}`}
        className="item-image"
      />
    ));

  const spellImages = summonerSpells.map((spellName, index) => (
    <img
      key={`spell-${spellName}-${index}`}
      src={`https://ddragon.leagueoflegends.com/cdn/${version}/img/spell/${spellName}.png`}
      alt={`Spell ${spellName}`}
      className="summoner-spell-image"
      style={{ width: '30px', height: '30px' }}
    />
  ));

  const runeImages = runes.map((runeStyle, index) => {
    const styleName = RUNE_STYLE_NAMES[runeStyle.style] || 'Unknown';
    const perkName = RUNE_PERK_NAMES[runeStyle.selections[0].perk] || 'Unknown';

    return (
      <img
        key={`rune-${index}`}
        src={`https://ddragon.leagueoflegends.com/cdn/img/perk-images/Styles/${styleName}/${perkName}/${perkName}.png`}
        alt={`Rune ${styleName}`}
        className="rune-image"
        style={{ width: '30px', height: '30px' }}
      />
    );
  });

  // Split participants into two teams
  const team1 = participants.slice(0, 5);
  const team2 = participants.slice(5, 10);

  const team1Details = team1.map((participant, index) => {
    const championImageUrl = `https://ddragon.leagueoflegends.com/cdn/${version}/img/champion/${participant.championName}.png`;

    return (
      <div key={`team1-participant-${index}`} style={{ display: 'flex', alignItems: 'center', marginBottom: '5px' }}>
        <img
          src={championImageUrl}
          alt={participant.championName}
          className="participant-champion-image"
        />
        <span>{participant.summonerName}</span>
      </div>
    );
  });

  const team2Details = team2.map((participant, index) => {
    const championImageUrl = `https://ddragon.leagueoflegends.com/cdn/${version}/img/champion/${participant.championName}.png`;

    return (
      <div key={`team2-participant-${index}`} style={{ display: 'flex', alignItems: 'center', marginBottom: '5px' }}>
        <img
          src={championImageUrl}
          alt={participant.championName}
          className="participant-champion-image"
        />
        <span>{participant.summonerName}</span>
      </div>
    );
  });

  return (
    <div className="card match" style={{ border: `2px solid ${outcomeColor}` }}>
      {/* Left Side: Player's Match Info */}
      <div className="match-info-left">
        <div style={{ display: 'flex', alignItems: 'center', paddingBottom: '10px' }}>
          {championImage}
          <div style={{ display: 'flex', flexDirection: 'column', gap: '4px' }}>
            <h4 className={outcomeClass} style={{ margin: 0 }}>{matchOutcome}</h4>
            <p style={{ margin: 0, fontSize: '1.1em', fontWeight: 'bold' }}>
              {kills}/{deaths}/{assists} K/D/A
            </p>
            <p style={{ margin: 0, fontSize: '0.9em' }}>
              Duration: {gameDuration}
            </p>
          </div>
        </div>
        <div className="summoner-spells" style={{ marginBottom: '10px' }}>
          <strong>Summoner Spells:</strong> {spellImages}
        </div>
        <div className="runes" style={{ marginBottom: '10px' }}>
          <strong>Runes:</strong> {runeImages}
        </div>
        <div className="item-images">
          <strong>Items:</strong> {itemImages}
        </div>
      </div>

      {/* Right Side: Match Participants - Split into Two Teams */}
      <div className="match-participants-right">
        <div className="team-container" style={{ display: 'flex', justifyContent: 'space-between' }}>
          {/* Team 1 */}
          <div className="team" style={{ width: '48%' }}>
            <h5 style={{ color: '#ffcc00', marginBottom: '10px' }}>Team 1:</h5>
            {team1Details}
          </div>
          {/* Team 2 */}
          <div className="team" style={{ width: '48%' }}>
            <h5 style={{ color: '#ffcc00', marginBottom: '10px' }}>Team 2:</h5>
            {team2Details}
          </div>
        </div>
      </div>
    </div>
  );
}

export default Match;
